import React, {Component} from 'react';

import Button from '../../components/ui/button/Button';
import userIcon from '../../img/navImg/user-plus-solid.svg';
import './SignUp.css';

class SignUp extends Component{
   constructor(){
      super();
      this.state = {
         name:'',
         email:'',
         password: '',
         password2: '',
         faculty: '',
         errors: {}
      }
   };

   onChangeHandler = (e) => {

   };


   render(){
      return (
         <div className= "FormBox" id = "signUpForm">
            <img className="UserIcon" src={userIcon} alt=""/>
            <form className="Form" noValidate>
               <input className="Input" value = {this.state.name} type="text" placeholder = "Full Name"/>
               <input className="Input" value = {this.state.email} type="email" placeholder = "Email"/>
               <input className="Input" value = {this.state.password} type="password" placeholder = "Password"/>
               <input className="Input" value = {this.state.password2} type="password" placeholder = "Confirm Password"/>
            </form>
            <select name="faculty" value = {this.state.faculty} className="Input" form="signUpForm">
               <option value="">Faculty</option>
               <option value="Computer">Computer Engineering</option>
               <option value="Civil">Civil Engineering</option>
               <option value="Mechanical">Mechanical Engineering</option>
               <option value="Electronics">Electronics Engineering</option>
               <option value="Electrical">Electrical Engineering</option>
               <option value="Geomatics">Geomatics Engineering</option>
               <option value="Automobile">Automobile Engineering</option>
            </select>

            <Button cls = "Success" value = "Sign Up" />

         </div>
      )
   }
}

export default SignUp;
